    {
      date:new Date(2021, 11, 25),
      description: "Мак",
      amount: 125.99
    },
    {
      date:new Date(2021, 5, 12),
      description: "Ttt",
      amount: 99.99
    },
  ]



  return (
    <div>
      <Costitem date={costs[0].date} description={costs[0].description } amount={costs[0].amount} />
      <Costitem />
      <Costitem />
    </div>
  );
}

export default App;
